import React from 'react';

const MySelect = ({options}) => {
    return (
        <select>
            <option disabled value=""></option>
            {options.map(option =>
                <option value={option.value}>
                    {option.name}
                </option>
            )}
        </select>
    );
};

export default MySelect;
